class Home extends Component {
  render() {
    return (
      <>
        <section className="home_section">
          <div className="container">
            <div className="row">
              <div className="col-md-6 m-auto text-center">
                <p>We Create Design's We Are</p>
                <h1>PROTO</h1>
                <p>The Best Choice Of your new website</p>
              </div>
            </div>
          </div>
        </section>
      </>
    );
  }
}

export default Home;
